Response: 
Սպանություններ: 
1. Հետազոտողները շատ վերցրել տեսությունը;
2. Անհատները շատ հետ վերցրել տեսությունը;
3. Հետազոտողները շատ վերցրել տեսությունը, բայց Անհատները շատ հետ վերցրել տեսությունը;
4. Հետազոտողները շատ վերցրել տեսություνը, բայց Անհատները շատ հետ վերցրել տեսությունը;
5. Հետազոտողները շատ վերցրել տեսությունը, բայց Անհատները շատ վերցրել տեսությունը;
6. Հետազոտողները շատ վերցրել տեսությունը, բայց Անհատները շատ հետ վերցրել տեսությունը;
7. Հետազոտողները շատ վերցրել տեսությո
